import React from 'react';
import {SafeAreaView} from "react-native";
import {Card, TextInput} from "react-native-paper";

const Login = () => {
    return (
        <SafeAreaView>
            <Card>
                <Card.Title title="Delivery"></Card.Title>
                <Card.Content>
                    <TextInput label="Delivery App" keyboardType="email"></TextInput>
                </Card.Content>
            </Card>
        </SafeAreaView>
    );
}

export default Login;
